import React, {Component} from 'react';
import './ShopDetails.scss';
import {NavLink} from "react-router-dom";
import { Tabs } from 'antd';
class ShopDetails extends Component {
    render() {
        const TabPane = Tabs.TabPane;
        return (
            <div className="shopDetails">
                {/*1、头部*/}
                <div className="head">
                    <img src={require("../../../static/img/ShopDetails/fff.webp")} alt="shoplogo"/>
                    
                </div>
                {/*2、标题部分*/}
                <div className="title">
                    {/*2.1名称*/}
                    <h2>东池便当(高新店)<span className="iconfont icon-youla"></span></h2>
                    {/*2.2分数*/}
                    <div className="cont">
                        <span>评分4.9</span>
                        <span>月售509单</span>
                        <span>蜂鸟转送24分钟</span>
                    </div>
                    {/*2.3优惠*/}
                    <div className="preferential">
                        <div className="mreduce">
                            <span className="reduce">满减</span>
                            <span>满10减8</span>
                            <span>满35减15</span>
                            <span>满88减40</span>
                        </div>
                        <div className="morepreferential">15个优惠<span className="iconfont icon-xiala1"></span></div>
                    </div>
                    {/*2.4公告*/}

                    <div className="notice">
                        公告：风行台湾的盒餐，原滋原味呈现！
                    </div>

                </div>
                {/*3分类区块:用户选择*/}
                <Tabs defaultActiveKey="1" >
                    <TabPane tab="44" key="1">Content of Tab Pane 1</TabPane>
                    <TabPane tab="Tab 2" key="2">Content of Tab Pane 2</TabPane>
                    <TabPane tab="Tab 3" key="3">Content of Tab Pane 3</TabPane>
                </Tabs>



            </div>
        );
    }
}

export default ShopDetails ;
